import styled from "styled-components";

type ContainerProps = {
    done: boolean;
}

export const Container = styled.div(({done}) => (
    `
    display: flex;
    align-items: center;
    gap: 5px;
    background: #20212C;
    padding: 10px;
    border-radius: 10px;
    margin-bottom: 10px;
    margin-top: 10px;

    label{
        color: #CCC;
    }

    input{
        width: 25px;
        height: 25px;
    }
`
));
